import React from 'react';
import Login from './components/Login';
import Register from './components/Register';


const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />

      </Switch>
    </Router>
  );
};

export default App;
